import React from 'react';
import {Container,Header} from 'semantic-ui-react';
const fullpost=(props)=>{
    return(
        <div>
            <Container text="true"   color="blue">
                <Header>{props.title}</Header>
                <p>{props.content}</p>


            </Container><br></br><br></br>
        </div>
    )
}

export default fullpost;
